(1644, 'R', 'BZLF1', 'BZ1', 'Santa Cruz', 'SC-53904', '', '', '', 'mouse', 'human', '', '15 8 8 RM', 'H220', '1000', '4 oC', 'Bing and Lisa,\r\n\r\nI just sat with Tanner to look at the BZLF1 and EBNA1. The control is lung, which I don’t is EBV positive (I am not sure why it was chosen), but I could tell from the clots. This are my conclusions:\r\n\r\n- BZLF1 is great. I would go with H2(20).\r\n\r\n-EBNA1- It looks OK in our block, but there is a lot of background in the cytoplasm of some cells (which may be macrophages, but I’m not sure).  It could also be stronger, but I am less concerned about this. If we are just using it for cell line blocks, it is acceptable, and I would go with  H1(30). But if we want it for cases, I think that we need to develop a bit further. Can we do some blocking, and try again? I don’t now if concentrating further plush blocking would give us a stronger stain and less background. A better control would be Hodgkin lymphoma. \r\n\r\nThanks,\r\n\r\nEthel\r\n', 'https://datasheets.scbt.com/sc-53904.pdf', 'upload/pdf/1325144137.'),
